import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-sample-page',
  templateUrl: './sample-page.component.html',
  styleUrls: ['./sample-page.component.css']
})
export class SamplePageComponent {

  constructor(private router:Router){

  }
  formData = {
    firstName: '',
    lastName: '',
    age: null,
    address: '',
    phone: '',
    passportNumber: ''
  };

  submitForm() {
    console.log('Form submitted:', this.formData);
    this.router.navigate(['passport'])
  }
}
<div class="box-form">
	<div class="left">
		<div class="overlay">
		<h1>Passport Details</h1>

		</div>
	</div>

		<div class="right">
		<div class="inputs">
			<input type="text" placeholder="user name" [(ngModel)]="details.firstName" #FnameInput name="firstname">
			<br>
			<input type="password" placeholder="last name">
			<br>
			<input type="text" placeholder="Age">
			<br>
			<input type="text" placeholder="address">
			<br>
			<input type="text" placeholder="Phone">
			<br>
			<input type="text" placeholder="Passport Id">
		</div>

			<br><br>

			<br>
			<button (click)="submitForm()">Verify</button>
	</div>

</div>
